function Yse(a){YDe(a.f,'Welcome! Press enter to get started!');YDe(a.f,'Quicksort is among the fastest sorting algorithms');YDe(a.f,"The first step of Quicksort is to 'partition' the array.");YDe(a.f,'To partition, we select some pivot element within the array.');YDe(a.f,'Different quicksort variants choose the pivot differently.');YDe(a.f,"We'll just use the middle element.");YDe(a.f,Tnf);YDe(a.f,'Click on the middle element to make it the pivot.');YDe(a.f,'Now, the purple element is our pivot.');YDe(a.f,'Our goal is to figure something out about the pivot...');YDe(a.f,"We want to figure out it's correct place in the sorted array.");YDe(a.f,'So, the center might be the wrong (sorted) pivot spot...');YDe(a.f,"We can figure out the pivot's correct spot by 'partitioning'.");YDe(a.f,"So, what exactly is 'partitoning the array'?");YDe(a.f,"Well, basically it's re-arranging elements based on the pivot.");YDe(a.f,'We want elements smaller than the pivot to the left...');YDe(a.f,'...and we want elements bigger than pivot to the right.');YDe(a.f,'Before partitioning, we need to move the pivot out of the way.');YDe(a.f,"Basically, we're hiding the pivot until we know where it goes.");YDe(a.f,'Different quicksort variants hide the pivot in different ways...');YDe(a.f,"We'll just tuck it away at the start of our array sequence.");YDe(a.f,Unf);YDe(a.f,'Drag the pivot to the first element, and release to swap.');YDe(a.f,"So, the pivot's hidden -- but what are those arrow 'pointers'?");YDe(a.f,'The pointers are our place holders while we partition.');YDe(a.f,'In regards to their colors...');YDe(a.f,"Let's say that anything 'red' is 'smaller' than the pivot...");YDe(a.f,'...and anything blue is bigger than the pivot.');YDe(a.f,'So: red = smaller; blue = bigger.');YDe(a.f,"Now, we're going to 'color-code' elements based on size");YDe(a.f,"Let's move red pointer right marking red (smaller) elements");YDe(a.f,Vnf);YDe(a.f,'Like that!');YDe(a.f,'The next element is also smaller than the pivot...');YDe(a.f,'...since it is smaller, it should be red too.');YDe(a.f,Vnf);YDe(a.f,Wnf);YDe(a.f,'You try, click the next element to color code it.');YDe(a.f,"But don't actually think of this as color coding...");YDe(a.f,"What we're really doing is sliding the red pointer.");YDe(a.f,"We're sliding it passed smaller elements...");YDe(a.f,'...searching for a larger element.');YDe(a.f,"The red pointer's element is larger than the purple pivot...");YDe(a.f,'Since it is larger, we should label it blue.');YDe(a.f,Xnf);YDe(a.f,'Continue clicking on the element until it is blue.');YDe(a.f,"Here's where we change things up...");YDe(a.f,'...now we want to slide the blue pointer passed larger elements.');YDe(a.f,"Essentially, it's looking for a smaller-than-pivot element");YDe(a.f,'Since the element at the blue pointer is larger...');YDe(a.f,Ynf);YDe(a.f,'... it needs to be blue; please change its color to blue.');YDe(a.f,'Now the blue pointer has found a smaller element!');YDe(a.f,Znf);YDe(a.f,'Please label it red, since it is smaller than the pivot.');YDe(a.f,"The moment we've been waiting for! ...");YDe(a.f,'...the two pointers have found their targets.');YDe(a.f,'The next step is to swap the elements at the two pointers! ');YDe(a.f,'Swapping corrects the relative position of the elements...');YDe(a.f,"...we're trying to get all red on the left, and all blue on the right.");YDe(a.f,$nf);YDe(a.f,"Swap the two pointer's elements (click and drag).");YDe(a.f,'Did you notice the pointers update?');YDe(a.f,'The red pointer moved right, the blue moved left.');YDe(a.f,'Now what? Well, in this case we re-position the pivot.');YDe(a.f,'But normally, we will repeat blue and red pointer scanning.');YDe(a.f,'Normally, we scan again until the pointers cross.');YDe(a.f,'But only when the pointers cross each other...');YDe(a.f,'...do we reposition the pivot into the array.');YDe(a.f,'Now then, since our pointers crossed over each other...');YDe(a.f,"...we're ready to position the pivot!");YDe(a.f,"We need to swap the pivot into it's correct place...");YDe(a.f,'...and the correct place is at one of the pointers.');YDe(a.f,'Can you guess which pointer we will swap with the pivot?');YDe(a.f,'Since we want all red on the left, and all blue on the right...');YDe(a.f,'We will swap with red element currently at the blue pointer...');YDe(a.f,'We do this because we hid the pivot on the left (red) side.');YDe(a.f,_nf);YDe(a.f,'Swap the pivot with the blue pointer element, please.');YDe(a.f,"We've now completed our first partition!");YDe(a.f,'Quicksort is a recursive algorithm, ...');YDe(a.f,'... which means we recurse(repeat) on smaller subproblems');YDe(a.f,'In this case, we have two smaller subproblems, ...');YDe(a.f,'...our two subproblems are beside our last pivot!');YDe(a.f,"So, let's repeat and partition on both sides of the old pivot.");YDe(a.f,'Starting with the left half, we need a pivot.');YDe(a.f,'When there are two middle elements, choose the left.');YDe(a.f,Tnf);YDe(a.f,'Above the left gray bar, pick the pivot (middle) element.');YDe(a.f,'Now we need to hide the pivot again...');YDe(a.f,"... we're going to hide it to the far left again.");YDe(a.f,"It may seem like we're always hiding it in the leftmost spot...");YDe(a.f,'...but we can only hide it within the current subproblem...');YDe(a.f,'... which means always hide the pivot within the gray bar');YDe(a.f,Unf);YDe(a.f,'Now, hide the pivot on the far left (swap).');YDe(a.f,'Now we need to label elements red again...');YDe(a.f,'... the first scan always starts at the red pointer...');YDe(a.f,'we mark elements red until reaching a bigger element');YDe(a.f,Xnf);YDe(a.f,'Scan over all the red elements, and mark the last one blue.');YDe(a.f,'Nice! now time to start our left scan...');YDe(a.f,'The second scan always starts at the blue pointer...');YDe(a.f,'...and moves left, marking blue elements...');YDe(a.f,'...until it reaches a red element.');YDe(a.f,Znf);YDe(a.f,'From blue pointer, label larger elements blue.');YDe(a.f,"This time we don't need to swap the pointers...");YDe(a.f,'...the blue pointer has already passed the red pointer');YDe(a.f,'When our pointers cross places, it is time to position the pivot.');YDe(a.f,'Remember, every time move the pivot out of hiding...');YDe(a.f,'...we move it to the spot of the blue pointer.');YDe(a.f,_nf);YDe(a.f,'Now then, correctly position pivot into the subproblem.');YDe(a.f,'We just completed another partitioning...');YDe(a.f,'...which means we are done with this subproblem.');YDe(a.f,'notice our new pivot split the region into two halves.');YDe(a.f,'Now we need to pick a pivot one of these subproblems.');YDe(a.f,'Notice the gray underline only covers 1 element.');YDe(a.f,'This means we have a subproblem size of 1.');YDe(a.f,'So, we only have 1 element to pick a pivot from...');YDe(a.f,'...which means this element is already correctly positioned!');YDe(a.f,'This is what we call a base case...');YDe(a.f,'Base cases are essentially the end the of recursion.');YDe(a.f,aof);YDe(a.f,'Please click the one element to label purple.');YDe(a.f,'Now we only have two elements above the gray bar...');YDe(a.f,'...which is another base case!');YDe(a.f,"Again, we don't need to recursively partition anymore.");YDe(a.f,"We only need to swap the two if they're out of order.");YDe(a.f,aof);YDe(a.f,"Since these two are out of order, let's swap the elements..");YDe(a.f,"Again we're presented with the two element base case.");YDe(a.f,aof);YDe(a.f,"They're out of order, so let's swap.");YDe(a.f,'And we have it, the entire array has been sorted!');YDe(a.f,"Now that you've seen the basics...");YDe(a.f,"...you're ready to try some more challenging arrays.");YDe(a.f,"If you get stuck, press 'enter' to see the next step...");YDe(a.f,'I suggest letting the computer solve the first one...');YDe(a.f,'...it may help to see how it is done quickly.');YDe(a.f,'But after a few, try to solve the steps on your own.');YDe(a.f,"Press 'space' at anytime to see keyboard shortcuts.");YDe(a.f,"Now, press 'N' for a normal array, or 'B' for a big array.")}
